import React from 'react';
import s from './filterForm.module.css'

const FilterForm = () => {
    return (
        <div>
            <form action="">
                <select className={s.select1} id="">
                    <option value="">a</option>
                    <option value="">a</option>
                    <option value="">a</option>
                </select>
                <select className={s.select1} id="">
                    <option value="">a</option>
                    <option value="">a</option>
                    <option value="">a</option>
                </select>
            </form>
        </div>
    );
};

export default FilterForm;
